import { AppBar, Toolbar, Typography } from "@mui/material";

const Header = () => {
  return (
    <>
      <AppBar position="fixed" style={{ backgroundColor: "#222222" }}>
        <Toolbar>
          <Typography variant="h2" fontSize={50}  >
            The Venue
          </Typography>
        </Toolbar>
      </AppBar>
    </>
  );
};

export default Header;
